import React from 'react';
import './Navbar.css';

const Navbar = () => {
    return(
        <header className ='head1'>
            <div className = 'navhead'>
                <div className = 'navhead1'>
                    <div className = 'Coinstartborder'>
                        <div className= 'coinbaseborder'>
                          <a className='coinanchor' title="Home" data-element-handle="header-home-link" href="/">
                            <img src="https://images.ctfassets.net/q5ulk4bp65r7/3TBS4oVkD1ghowTqVQJlqj/2dfd4ea3b623a7c0d8deb2ff445dee9e/Consumer_Wordmark.svg" height="20" width="112" alt="Coinbase Logo" className='coinlogo'>
                                </img>
                            </a>
                        <div className='Navtags'>
                                <div className='signintab'>

                                </div>
                            </div>
                        </div>
                    </div>
                </div>

            </div>
        </header>
    );
}
export default Navbar;
